      matchup[0] = <img className="logos" src={kanLogo} alt="logo" width="87" height="87"/>
    }
    if (homeTeam.find(a => a.includes(rai)))
    {
      matchup[1] = <img className="logos" src={raiLogo} alt="logo" width="87" height="87"/>
    }
    else if (awayTeam.find(b => b.includes(rai)))
    {
      matchup[0] = <img className="logos" src={raiLogo} alt="logo" width="87" height="87"/>
    }
    if (homeTeam.find(a => a.includes(rav)))
    {
      matchup[1] = <img className="logos" src={ravLogo} alt="logo" width="87" height="87"/>
    }
    else if (awayTeam.find(b => b.includes(rav)))
    {
      matchup[0] = <img className="logos" src={ravLogo} alt="logo" width="87" height="87"/>
    }

    return (matchup)

  }

  function setWeeklyMatchups()
  {
    return(
            teams.map(team =>
              <tr key={team.toString()}>
                <td className='matchups'>
                  {setEachMatchup(team)}
                </td>
              </tr>
            )
          )
  }


  return (
    <>
    <table className="allTeams">
      <tbody>

        <tr>
          <th >Week 1 Match ups</th>
        </tr>

        {setWeeklyMatchups()}

      </tbody>
    </table>
    </>
  );
}

export default NewHome;
